import { CardChildComponent } from "./CardChildComponent"

export const ParentComponent = () => {
    const fruits = [
        {
            id: 1,
            name: 'Banana',
            color: 'yellow',
            taste: 'sweet',
            image: 'banana.jpg'
        },
        {
            id: 2,
            name: 'Apple',
            color: 'green',
            taste: 'sour',
            image: 'https://www.https://www.stylecraze.com/wp-content/uploads/2013/06/Top-26-Amazing-Benefits-Of-Green-Apples-For-Skin-Hair-And-Health-1_1200px.jpg.webp.com/infotheque/wp-content/uploads/2023/03/banane-1a-1200x838.jpg'
        },
        {
            id: 3,
            name: 'Strawberry',
            color: 'red',
            taste: 'sweet',
            image: 'https://www.https://https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcSJxlHWv_YX7tjnOLEZk0WYKTTBuJEeVGDzWs0dPL0a-aX1jlltXhckBU_Hjjyiz5wdLwUKgGEYF6N9wiYjXStWuA.stylecraze.com/wp-content/uploads/2013/06/Top-26-Amazing-Benefits-Of-Green-Apples-For-Skin-Hair-And-Health-1_1200px.jpg.webp.com/infotheque/wp-content/uploads/2023/03/banane-1a-1200x838.jpg'
        },
    ]

    return (
        <>
            <h1>Parent Component</h1>
            <div style={{display:'flex', flexDirection:'column', justifyContent:'center', gap:'20px'}}>
                {fruits.map((fruitInfo)=><CardChildComponent fruits={fruitInfo} key={fruitInfo.id}/>)}
            </div>
        </>
    )
}
